import React from 'react';
import logo from './logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Scova Foundation</p>
      </header>
      <Parallax filter image={require("./logo.png")}>
      <div className="App"><img src={logo} className="App-logo" alt="logo" /></div>
      </Parallax>
    </div>
  );
}

export default App;
